one\n            It’s no longer fun\n            What ever happened, to the magic\n            The spark\n            I guess it’s gone, it wasn’t really there\n            For long\n            \n            But it wasn’t just that\n            There were a million little issues\n            And I shouldn’t have to take it\n            I know better for myself\n            \n            Oh baby I’m leaving\n            I will miss you, will you miss me?\n            I have to go now\n            I can’t stay, you don’t need to wait\n            Cause I though you were the one\n            But we just ran out of luck\n            And when you see me someday\n            Don’t bother stand in my way\n            Cause we’re done\n            The race was run, it’s over, we’re done\n            \n            The race was run, we are done\n            It’s no longer fun\n            What ever happened, to the magic\n            The spark\n            I guess it’s gone, it wasn’t really there\n            For long','Song',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(221,'0109bfe2a49e008811721680796915',159,'i carry your heart with me','i carry your heart with me (i carry it in\n            my heart) i am never without it (anywhere\n            i go you go, my dear; and whatever is done\n            by only me is your doing, my darling)\n            i fear\n            \n            no fate (for you are my fate, my sweet) i want\n            no world (for beautiful you are my world, my true)\n            and it\'s you are whatever a moon has always meant\n            and whatever a sun will always sing is you ...','Poem',0,1,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(222,'2976f11565ddde7bead41680796915',27,'Free Verse','I now delight\n            In spite\n            Of the might\n            And the right\n            Of classic tradition,\n            In writing\n            And reciting\n            Straight ahead,\n            Without let