e donation, and took you home.\n            You\'re a little shelter cat no more. You\'re mine.','Poem',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(225,'1e638f00dfaf2ab8df9a1680796915',138,'Cat','Teacher: \'If I gave you 2 cats and another 2 cats and another 2, how many would you have?\'\n            Johnny: \'Seven.\'\n            Teacher: \'No, listen carefully... If I gave you two cats, and another two cats and another two, how many would you have?\'\n            Johnny: \'Seven.\'\n            Teacher: \'Let me put it to you differently. If I gave you two apples, and another two apples and another two, how many would you have?\'\n            Johnny: \'Six.\'\n            Teacher: \'Good. Now if I gave you two cats, and another two cats and another two, how many would you have?\'\n            Johnny: \'Seven!\'\n            Teacher: \'Johnny, where in the heck do you get seven from?!\'\n            Johnny: \'Because I\'ve already got a freaking cat!\'','Comedy',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(226,'12c2a29e3ad7fdf15a941680796915',113,'Duck','Q: What did the duck say when he bought lipstick?\n            A: \'Put it on my bill.\'','Comedy',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(227,'50fd887c9ca6d61eaac21680796915',97,'Beans','A teacher asked her students to use the word \'beans\' in a sentence. \'My father grows beans,\' said one girl. \'My mother cooks beans,\' said a boy. A third student spoke up, \'We are all human beans.\'','Comedy',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(228,'18b8c181783a8d1133b51680796915',175,'Mine baby','Your sitting there, all alone\n            So distant, I should know\n            I understand what your going through\n            And I recommend, you get someone to help you\n            I could that someone,\n            And you can be my number one girl\n            And I can treat you right\n            We can be burning bright, alright\n            \