ot, \'Was it you who said Jesus is watching me\' The parrot replied, \'Yes.\' Relieved, the burglar asked, \'What is your name?\' The parrot said, \'Clarence.\' The burglar said, \'That\'s a stupid name for a parrot. What idiot named you Clarence?\' The parrot answered, \'The same idiot that named the rottweiler Jesús.\'','Comedy',0,0,0,0,0,0,0,'',0,'2023-04-06T18:01:55+02:00',1680796915),(230,'29067dcbc8d616e108471680796915',99,'Teacher','Teacher: \'Kids, what does the chicken give you?\'\n            Student: \'Meat!\'\n            Teacher: \'Very good! Now what does the pig give you?\'\n            Student: \'Bacon!\'\n            Teacher: \'Great! And what does the fat cow give you?\'\n            Student: \'Homework!\'','Comedy',0,2,0,0,0,0,0,'',1,'2023-04-06T18:01:55+02:00',1680796915),(231,'b440492df81ad387b7701685713191',1,'Don\'t talk fake deep','She bugging me\nEhhhhhh\nBeep beep beep beeep beep\nJamoor jamoor\nI keep loving you','Story',0,2,0,0,0,0,0,'',1,'2023-06-02T15:39:51+02:00',1685713191);
